function fetch_question_count(t,e){var n=question_counts[fetch_category_id(t)];return n?n[e]:0}function fetch_user_count(t,e){var n=user_counts[fetch_category_id(t)];return n?n[e]:0}function fetch_unused_count(t){var e=question_counts[fetch_category_id(t)];if(e){var n=user_counts[fetch_category_id(t)];return n=n?n.used:0,e.all-n}return 0}function fetch_category_id(t){return $(t).find("input:first").val()}$(function(){$(".subCategoryList, .parentCategoryList").each(function(t,e){$(e).find("div.all:first").html(fetch_question_count(e,"all")),$(e).find("div.media:first").html(fetch_question_count(e,"media")),$(e).find("div.incorrect:first").html(fetch_user_count(e,"incorrect")),$(e).find("div.unused:first").html(fetch_unused_count(e)),$(e).find("div.marked:first").html(fetch_user_count(e,"marked"))}),$("#exam_question_type").trigger("change")});